  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Rice Lake
  NWR and Mille Lacs NWR outlines Refuge accomplishments during the 1972 calendar
  year. The report begins by summarizing the weather conditions, habitat conditions,
  water conditions, and food and cover conditions during the year. Wildlife- including
  migratory birds, upland game birds, big game animals, furbearers, predators, rodents,
  mammals, raptors, fish, and reptiles- is also covered. The Refuge development and
  maintenance section discusses physical developments, plantings, collections and
  receipts, and wildfires. The resources management section discusses grazing, haying,
  fur harvesting, and timber removal. A progress report on field investigations and
  applied research is included. The public relations section of the report describes
  recreational uses, hunting, fishing, violations, and safety. Items of interest are
  attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
